import React, { Fragment } from 'react';
import { Link } from "react-router-dom";
import {Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../../asset/css/style.css';

const Futer = () => {

    return (
        <Fragment>
   <Navbar className='navBack' collapseOnSelect expand="lg" bg="" variant="dark">
      <Container>                      
         <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="me-auto">
                  <Nav.Link as={Link} to='/'>Home</Nav.Link>
                     <NavDropdown title="বাংলা ওয়াজ" id="collasible-nav-dropdown">
                         <NavDropdown.Item as={Link} to='/'>Home</NavDropdown.Item>
                         <NavDropdown.Divider />
                         <NavDropdown.Item as={Link} to='/Practice'>p</NavDropdown.Item>
                     </NavDropdown>
                  <Nav.Link as={Link} to='/About'>About Us</Nav.Link>
                  <Nav.Link as={Link} to='/Terms_and_conditions'>Terms and Conditions</Nav.Link>
                  <Nav.Link as={Link} to='/Privacy_policy'>Privacy Policy</Nav.Link>
                  <Nav.Link as={Link} to='/Contact'>Contact Us</Nav.Link>
                 </Nav>
            </Navbar.Collapse>
        </Container>
    </Navbar>
</Fragment>
    )
}
export default Futer;
